import React from "react";
import "./App.css"
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

export default function BasicExample() {
  return (
    <Router>
      <div>



        <Switch>
          <Route exact path="/">
            <Home />
          </Route>
          <Route path="/about">
            <About />
          </Route>

        </Switch>
      </div>
    </Router>
  );
}

function Home() {
  return (
    <div className="main-container">
     <h6>Areca/ OSMF awareness</h6>
     <p>Creating opportunities for better health decisions</p>
     <a className="search" style={{fontSize: 'larger'}}><Link to="/about">DOWNLOAD HERE</Link></a>
 </div>
  );
}

function About() {
  return (
    <div className="main-container">
     <h6>Areca/ OSMF awareness</h6>
     <p>Creating opportunities for better health decisions</p>

 </div>
  );
}
